import Navbar from "../components/Navbar";
import Products from "../components/Products";
export default class Index extends React.Component{
    static async getInitialProps(ctx){
        return{
            hello: "Hello"
        }
    }
    render(){
        return(
                <React.Fragment>
                    <Navbar />
                    <Products />
                    {this.props.hello}
                </React.Fragment>
        );
    }
}
